import numpy as np
def remove_similar_row(A,threshold=0.8): 
    mask = np.zeros(len(A), dtype=np.bool)
    for i in range(len(A)):
        row = A[i]
        similar = True
        for j in range(i+1, len(A)):
            if np.linalg.norm(row - A[j]) < threshold:
                similar = False
                break
        if similar:
            mask[i] = True
    return A[mask == True]
